import { INTERNAL_SERVER_ERROR, OK } from 'http-status';
import responseHelper from '../helpers/responseHelper';

/**
 * This class contains method (function) required to handle.
 * All kinds of data which paginated.
 */
class PaginateData {
  /**
  * This method handle pagination of retrived data.
  * @param {object} req a datas request.
  * @param {object} res a response.
  * @returns {object} return status and data.
  */
  static paginateData(req, res) {
    try {
      req.data.paginate.paginate = req.data.allDatata;
      if (req.data.start > 0) {
        req.data.paginate.Previous = {
          page: req.data.pages - 1,
          limit: req.data.skip,
        };
      } if (req.data.end < req.data.countAllData) {
        req.data.paginate.Next = {
          page: req.data.pages + 1,
          limit: req.data.skip,
        };
      }

      const data = { count: req.data.count || 0, data: req.data.paginate };
      responseHelper.handleSuccess(OK, `Success, page ${req.data.pages}`, data);
      return responseHelper.response(res);
    } catch (error) {
      responseHelper.handleError(INTERNAL_SERVER_ERROR, error.toString());
      return responseHelper.response(res);
    }
  }
}
export default PaginateData;

/**
* This class contains all methods (functions) required to handle
* handleSuccess function.
* handleError function.
* response function.
*/
class ResponseHelpers {
  /**
   * Handle Success.
   * @param {integer} statusCode status code.
   * @param {integer} message message.
   * @param {object} data data.
   * @returns {null} .
   */
  static handleSuccess(statusCode, message, data) {
    this.statusCode = statusCode;
    this.message = message;
    this.data = data;
    this.type = 'success';
  }

  /**
   * Handle Error.
   * @param {integer} statusCode status code.
   * @param {integer} message message.
   * @returns {null} .
   */
  static handleError(statusCode, message) {
    this.statusCode = statusCode;
    this.message = message;
    this.type = 'error';
  }

  /**
   * Handle response.
   * @param {object} res response.
   * @returns {object} response.
   */
  static response(res) {
    if (this.type === 'success') {
      return res.status(this.statusCode).json({
        status: this.statusCode,
        message: this.message,
        data: this.data,
      });
    }
    return res.status(this.statusCode).json({
      status: this.statusCode,
      message: this.message,
    });
  }
}

export default ResponseHelpers;

import dotenv from 'dotenv';
import { INTERNAL_SERVER_ERROR, NOT_FOUND, CREATED, OK } from 'http-status';

import movieHelper from '../helpers/movieHelper';
import paginateHelper from '../helpers/paginateHelper';
import responseHelper from '../helpers/responseHelper';

dotenv.config();

/**
* This class contains all methods (functions) required to handle
* viewAllMovies function.
* viewFavoriteMovies function.
* addMovie
* viewMovie
* editMovie
*/
class MovieController {
  /**
     * Handle viewAllMovies.
     * @param {object} req user request.
     * @param {object} res data response.
     * @param {object} next move response.
     * @returns {object} response.
     */
  static async viewMovies(req, res, next) {
    try {
      const { start, end, pages, skip, paginate } = await paginateHelper.paginateData(req.query);
      const data = await movieHelper.viewMovies(skip, start);
      const count = await movieHelper.countMovies();

      const countAllData = data.count;
      const allDatata = data.rows;

      if (data.rows === undefined || data.rows.length === 0) {
        responseHelper.handleSuccess(NOT_FOUND, 'Movies not found', allDatata);
        return responseHelper.response(res);
      }

      req.data = { allDatata, countAllData, start, end, pages, skip, paginate, count };
      return next();
    } catch (error) {
      responseHelper.handleError(INTERNAL_SERVER_ERROR, error.toString());
      return responseHelper.response(res);
    }
  }

  /**
     * Handle viewMovie.
     * @param {object} req user request.
     * @param {object} res data response.
     * @returns {object} response.
     */
  static async viewMovie(req, res) {
    try {
      const data = await movieHelper.viewMovie(req.params.id);

      if (!data) {
        responseHelper.handleError(NOT_FOUND, `Movie with id ${req.params.id} not found`);
        return responseHelper.response(res);
      }

      responseHelper.handleSuccess(OK, `Success`, data);
      return responseHelper.response(res);
    } catch (error) {
      responseHelper.handleError(INTERNAL_SERVER_ERROR, error.toString());
      return responseHelper.response(res);
    }
  }

  /**
     * Handle addMovie.
     * @param {object} req user request.
     * @param {object} res data response.
     * @returns {object} response.
     */
  static async addMovie(req, res) {
    try {
      const data = await movieHelper.addMovie(req.body);

      responseHelper.handleSuccess(CREATED, `Success`, data);
      return responseHelper.response(res);
    } catch (error) {
      responseHelper.handleError(INTERNAL_SERVER_ERROR, error.toString());
      return responseHelper.response(res);
    }
  }

  /**
     * Handle editMovie.
     * @param {object} req user request.
     * @param {object} res data response.
     * @returns {object} response.
     */
  static async editMovie(req, res) {
    try {
      let data = await movieHelper.viewMovie(req.params.id);

      if (!data) {
        responseHelper.handleError(NOT_FOUND, `Movie with id ${req.params.id} not found`);
        return responseHelper.response(res);
      }

      data = await movieHelper.editMovie(req.params.id, req.body);
      responseHelper.handleSuccess(OK, `Success`, data);
      return responseHelper.response(res);
    } catch (error) {
      responseHelper.handleError(INTERNAL_SERVER_ERROR, error.toString());
      return responseHelper.response(res);
    }
  }

  /**
     * Handle deleteMovie.
     * @param {object} req user request.
     * @param {object} res data response.
     * @returns {object} response.
     */
  static async deleteMovie(req, res) {
    try {
      let data = await movieHelper.viewMovie(req.params.id);

      if (!data) {
        responseHelper.handleError(NOT_FOUND, `Movie with id ${req.params.id} not found`);
        return responseHelper.response(res);
      }

      data = await movieHelper.deleteMovie(req.params.id);
      responseHelper.handleSuccess(OK, `Success`);
      return responseHelper.response(res);
    } catch (error) {
      responseHelper.handleError(INTERNAL_SERVER_ERROR, error.toString());
      return responseHelper.response(res);
    }
  }
}

export default MovieController;

import tables from '../../config/database/models';

const { Movie } = tables;

/**
* This class contains all methods (functions) required to handle
* countMovies function.
* viewMovies function.
* addMovie function.
* viewMovie function.
* editMovie function.
* deleteMovie function.
*/
class MovieHelper {
  /**
     * Count all movies from movies table in database.
     * @returns {object} return data.
     */
  static async countMovies() {
    const data = await Movie.count();
    return data;
  }

  /**
   * View all movies from movies table in database.
   * @param {string} skip where to stop.
   * @param {string} start where to start.
   * @returns {object} return data.
   */
  static async viewMovies(skip, start) {
    const data = await Movie.findAndCountAll({ limit: skip, offset: start });
    return data;
  }

  /**
   * Add movie from movies table in database.
   * @param {object} body movie details.
   * @returns {object} return data.
   */
  static async addMovie(body) {
    const data = await Movie.create({
      createdAt: new Date(),
      updatedAt: new Date(),
      name: body.name,
      rating: body.rating,
      ranking: body.ranking,
      cast: body.cast,
      releaseDate: body.releaseDate
    });

    return data;
  }

  /**
   * View movie from movies table in database.
   * @param {integer} id movie id.
   * @returns {object} return data.
   */
  static async viewMovie(id) {
    const data = await Movie.findOne({ where: { id } });
    return data;
  }

  /**
   * Edit movie from movies table in database.
   * @param {integer} id movie id.
   * @param {object} body movie details.
   * @returns {object} return data.
   */
  static async editMovie(id, body) {
    await Movie.update({ ranking: body.ranking }, { where: { id } });

    return this.viewMovie(id);
  }

  /**
   * Delete movie from movies table in database.
   * @param {integer} id movie id.
   * @returns {string} a destroyed session.
   */
  static async deleteMovie(id) {
    const data = await Movie.destroy({ where: { id } });
    return data;
  }
}

export default MovieHelper;

