module.exports = (sequelize, DataTypes) => {
  const Movie = sequelize.define('Movie', {
    createdAt: { type: DataTypes.DATE },
    updatedAt: { type: DataTypes.DATE },
    name: { type: DataTypes.STRING },
    ranking: { type: DataTypes.NUMERIC },
    rating: { type: DataTypes.NUMERIC },
    cast: { type: DataTypes.ARRAY(DataTypes.STRING(1000)) },
    releaseDate: { type: DataTypes.DATE },
  }, {});

  return Movie;
};

/**
* This class contain method (function) required to handle
* The method return data.
*/
class PaginatingData {
  /**
   * Get page number and limit of data needed on single page.
   * @param {integer} page page number.
   * @param {integer} limit value to be found.
   * @returns {object} paginate tools.
   */
  static paginateData({ page, limit }) {
    const paginate = {};
    const skip = Number(limit || Number.MAX_SAFE_INTEGER);
    const pages = Number(page || 1);
    const start = Number((pages - 1) * skip);
    const end = page * skip;
    return {
      start, end, pages, skip, paginate
    };
  }
}

module.exports = PaginatingData;

import Joi from 'joi';
import validateSchema from './validateSchema';

/**
   * Handle validateRegisterUser.
   * @param {object} req user request.
   * @param {object} res data response.
   * @param {object} next move.
   * @returns {object} response.
   */
const validateAddMovie = (req, res, next) => {
  const dataSchema = Joi.object()
    .keys({
      name: Joi.string().min(3).max(50).required()
        .messages({
          'any.required': 'name is required',
          'string.empty': 'name is not allowed to be empty',
        }),
      ranking: Joi.number().required()
        .messages({
          'any.required': 'ranking is required',
          'string.empty': 'ranking is not allowed to be empty',
        }),
      rating: Joi.number().required()
        .messages({
          'any.required': 'rating is required',
          'string.empty': 'rating is not allowed to be empty',
        }),
      cast: Joi.array().min(1).items(Joi.string()).required()
        .messages({
          'any.required': 'cast is required',
          'string.empty': 'cast is not allowed to be empty',
        }),
      releaseDate: Joi.date().required()
        .messages({
          'any.required': 'releaseDate is required',
          'string.empty': 'releaseDate is not allowed to be empty',
        }),
    })
    .options({ abortEarly: false });

  return validateSchema(dataSchema, req.body, res, next);
};

/**
   * Handle validateRegisterUser.
   * @param {object} req user request.
   * @param {object} res data response.
   * @param {object} next move.
   * @returns {object} response.
   */
const validateRankMovie = (req, res, next) => {
  const dataSchema = Joi.object()
    .keys({
      ranking: Joi.number().required()
        .messages({
          'any.required': 'ranking is required',
          'string.empty': 'ranking is not allowed to be empty',
        }),
    })
    .options({ abortEarly: false });

  return validateSchema(dataSchema, req.body, res, next);
};

export { validateAddMovie, validateRankMovie };

import { BAD_REQUEST } from 'http-status';
import helper from '../helpers/responseHelper';

/**
   * Handle Success.
   * @param {object} schema schema.
   * @param {object} body user body request.
   * @param {object} res data response.
   * @param {object} next move.
   * @returns {object} response.
   */
const validateSchema = (schema, body, res, next) => {
  const { error } = schema.validate(body);

  if (error) {
    const errors = error.details.map((err) => err.message);
    helper.handleError(BAD_REQUEST, errors[0].replace(/"/g, ''));
    return helper.response(res);
  }

  return next();
};

export default validateSchema;
